var bs={init:function(){bs.initCopyHandle()},initCopyHandle:function(){$("[data-action]").on("click",function(){$(this).data("action")=="copy"?bs.copy(this):bs.delete(this)})},copy:function(n){var t=$(n).data("url");clipboard.write(t);alert("File download url copied to the clipboard\n"+t)},"delete":function(n){var t=confirm("Are you sure you want to delete the file? "+$(n).data("filename"));t==!0&&$.ajax({type:"post",url:"/Media/Home/RemoveFile",data:{FullName:$(n).data("filename")},success:function(n,t,i){if(i.status=="200"){location.reload();return}},error:function(n){if(n.status=="200"){location.reload();return}alert("Failed to delete the file "+n.status+" "+n.statusText)},dataType:"json"})}},clipboard={write:function(n){if(!navigator.clipboard){clipboard.writeFailSafe(n);return}navigator.clipboard.writeText(n).then(function(){console.log("Async: Copying to clipboard was successful!")},function(n){console.error("Async: Could not copy text: ",n)})},writeFailSafe:function(n){var t=document.createElement("textarea"),i,r;t.value=n;t.style.top="0";t.style.left="0";t.style.position="fixed";document.body.appendChild(t);t.focus();t.select();try{i=document.execCommand("copy");r=i?"successful":"unsuccessful";console.log("Fallback: Copying text command was "+r)}catch(u){console.error("Fallback: Oops, unable to copy",u)}document.body.removeChild(t)}};